@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Transaction a owl:Class .
atm:SuccessfulTransaction a owl:Class .
atm:UnsuccessfulTransaction a owl:Class .
atm:ErrorMessage a owl:Class .
atm:Card a owl:Class .
atm:EjectedCard a owl:Class .

atm:UnsuccessfulTransaction rdfs:subClassOf atm:Transaction .
atm:EjectedCard rdfs:subClassOf atm:Card .

atm:hasErrorMessage a owl:ObjectProperty ;
    rdfs:domain atm:UnsuccessfulTransaction ;
    rdfs:range atm:ErrorMessage .

atm:hasEjectedCard a owl:ObjectProperty ;
    rdfs:domain atm:UnsuccessfulTransaction ;
    rdfs:range atm:EjectedCard .

atm:SuccessfulTransaction owl:disjointWith atm:UnsuccessfulTransaction .
atm:UnsuccessfulTransaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:hasErrorMessage ;
    owl:someValuesFrom atm:ErrorMessage
] .

atm:UnsuccessfulTransaction rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:hasEjectedCard ;
    owl:someValuesFrom atm:EjectedCard
] .
